import React, { Component } from 'react';
import {
  Link
} from 'react-router-dom';
import logo from '../img/Logo/angel-logo-finnal.png'
class Header extends Component {
    render() {
      return (

        <header>

          <nav>           

            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/about/">About</Link>
              </li>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/about/">About</Link>
              </li>
            </ul>
          </nav>  

        </header>

      );
    }
  }

  export default Header;
